import "./Sidebar.css";
import React from "react";
import { Col, Row } from "react-bootstrap";

const Sidebar = ({}) => {
  return (
    <div className="sidebar">
      <Col>
        <Row><a>Projects</a></Row>
        <Row><a>Education</a></Row>
        <Row><a>Experience</a></Row>
        <Row><a>Skills</a></Row>
        <Row><a>Achievements</a></Row>
      </Col>
    </div>
  );
};

export default Sidebar;
